import { useEffect } from 'react';
import { useParams } from 'react-router-dom';

function Room({ socket }) {
    const { roomID } = useParams();

    useEffect(() => {
        socket.emit("joinRoom", { roomID: roomID });
    }, []);

    useEffect(() => {
        socket.on("joinRoomResponse", (data) => {
            console.log(data);
        });
    }, [socket]);

    return (
        <div>
            Room
        </div>
    );
}

export default Room;
